import React from "react";
import { NavLink } from "react-router-dom";

const NavLinks = ({ children, link, clicked, mobile }) => {
  !mobile && (
    <>
      <li onClick={clicked}>
        <a>{children}</a>
      </li>
    </>
  );
};

export default NavLinks;
